const Sidebar = (props) => {

    return (<div className={c.sidebar}>
        <Menu sidebar={props.state.sidebarPage.sideb}/>
       <Friends friends={props.state.sidebarPage.friends}/>
        </div>
    )
}

export default Sidebar;
